import UIKit

class BestSolution {
    
    func findAnagrams(_ s: String, _ p: String) -> [Int] {
        var res = [Int]()
        var s = Array(s), p = Array(p)
        var hash = [Int](repeating: 0, count: 256)
        
        for c in p {
            hash[getHash(c)] += 1
        }
        
        var left = 0 , right = 0 , count = p.count
        
        while right < s.count {
            if hash[getHash(s[right])] >= 1 {
                count -= 1
            }
            hash[getHash(s[right])] -= 1
            right += 1
            
            if count == 0 { res.append(left) }
            
            if right - left == p.count {
                if hash[getHash(s[left])] >= 0 {
                    count += 1
                }
                hash[getHash(s[left])] += 1
                left += 1
            }
        }
        return res
    }
    
    func getHash(_ c: Character) -> Int {
        return Int(c.unicodeScalars.first!.value)
    }
}

class Solution {
    
    var strs = [String]()
    var result = [Int]()
    
    func findAnagrams(_ s: String, _ p: String) -> [Int] {
        if p.count > s.count {
            return result
        }
        arrange(Array(p), 0, p.count)
        for str in strs {
            for range in ranges(s, str) {
                let startPos = s.distance(from: s.startIndex, to: range.lowerBound)
                if !result.contains(startPos) {
                    result.append(startPos)
                }
            }
        }
        return result.sorted()
    }
    
    func arrange(_ chs: [Character], _ start: Int, _ len: Int) {
        var chs = chs
        if start == len - 1 {
            strs.append(String(chs))
            return
        }
        for index in start ..< len {
            var temp = chs[start]
            chs[start] = chs[index]
            chs[index] = temp
            arrange(chs, start + 1, len)
            temp = chs[start]
            chs[start] = chs[index]
            chs[index] = temp
        }
    }
    
    func ranges(_ s: String, _ string: String) -> [Range<String.Index>] {
        var rangeArray = [Range<String.Index>]()
        var searchedRange: Range<String.Index>
        var searchedRangeLeft = 0
        guard let sr = s.range(of: s) else {
            return rangeArray
        }
        searchedRange = sr
        var resultRange = s.range(of: string, options: .regularExpression, range: searchedRange, locale: nil)
        while let range = resultRange {
            rangeArray.append(range)
            searchedRange = Range(uncheckedBounds: (s.index(s.startIndex, offsetBy: searchedRangeLeft), searchedRange.upperBound))
            resultRange = s.range(of: string, options: .regularExpression, range: searchedRange, locale: nil)
            searchedRangeLeft += 1
        }
        return rangeArray
    }
}

extension String {
    func ranges(_ string: String) -> [Range<String.Index>] {
        var rangeArray = [Range<String.Index>]()
        var searchedRange: Range<String.Index>
        var searchedRangeLeft = 0
        
        guard let sr = self.range(of: self) else {
            return rangeArray
        }
        searchedRange = sr
        
        var resultRange = self.range(of: string, options: .regularExpression, range: searchedRange, locale: nil)
        while let range = resultRange {
            rangeArray.append(range)
            searchedRange = Range(uncheckedBounds: (self.index(self.startIndex, offsetBy: searchedRangeLeft), searchedRange.upperBound))
            resultRange = self.range(of: string, options: .regularExpression, range: searchedRange, locale: nil)
            searchedRangeLeft += 1
        }
        return rangeArray
    }
}

